INSERT INTO `custom_page_translations` (`id`, `custom_page_id`, `lang_code`, `name`, `content`, `created_at`, `updated_at`) VALUES
(1, 1, 'en', 'privacy policy', '<p>Welcome to SkillGro! We value your privacy and are committed to protecting your personal information. This Privacy Policy outlines how we collect, use, and safeguard your data when you visit our website.</p>\r\n<p><strong>Information We Collect</strong></p>\r\n<ol>\r\n<li>\r\n<p><strong>Personal Information</strong>: When you register on our site, subscribe to our newsletter, or fill out a form, we may collect personal information such as your name, email address, phone number, and any other details you provide.</p>\r\n</li>\r\n<li>\r\n<p><strong>Non-Personal Information</strong>: We may collect non-personal information about visitors whenever they interact with our site. This may include the browser name, the type of computer, and technical information about users\' means of connection to our site, such as the operating system and the Internet service providers utilized and other similar information.</p>\r\n</li>\r\n<li>\r\n<p><strong>Cookies and Tracking Technologies</strong>: Our site may use \"cookies\" to enhance user experience. Users\' web browsers place cookies on their hard drive for record-keeping purposes and sometimes to track information about them. Users may choose to set their web browser to refuse cookies or to alert them when cookies are being sent. If they do so, note that some parts of the site may not function properly.</p>\r\n</li>\r\n</ol>\r\n<p><strong>How We Use Collected Information</strong></p>\r\n<p>SkillGro may collect and use users\' personal information for the following purposes:</p>\r\n<ol>\r\n<li>\r\n<p><strong>To Improve Customer Service</strong>: Information you provide helps us respond to your customer service requests and support needs more efficiently.</p>\r\n</li>\r\n<li>\r\n<p><strong>To Personalize User Experience</strong>: We may use information in the aggregate to understand how our users as a group use the services and resources provided on our site.</p>\r\n</li>\r\n<li>\r\n<p><strong>To Improve Our Site</strong>: We may use feedback you provide to improve our products and services.</p>\r\n</li>\r\n<li>\r\n<p><strong>To Process Payments</strong>: We may use the information users provide about themselves when placing an order only to provide service to that order. We do not share this information with outside parties except to the extent necessary to provide the service.</p>\r\n</li>\r\n<li>\r\n<p><strong>To Send Periodic Emails</strong>: We may use the email address to send user information and updates pertaining to their order. It may also be used to respond to their inquiries, questions, and/or other requests.</p>\r\n</li>\r\n</ol>\r\n<p><strong>How We Protect Your Information</strong></p>\r\n<p>We adopt appropriate data collection, storage, and processing practices and security measures to protect against unauthorized access, alteration, disclosure, or destruction of your personal information, username, password, transaction information, and data stored on our site.</p>', '2024-06-05 01:15:39', '2024-06-07 13:30:28'),
(2, 1, 'hi', 'गोपनीयता नीति', '<p>SkillGro में आपका स्वागत है! हम आपकी गोपनीयता को महत्व देते हैं और आपकी व्यक्तिगत जानकारी की सुरक्षा के लिए प्रतिबद्ध हैं। यह गोपनीयता नीति बताती है कि जब आप हमारी वेबसाइट पर जाते हैं तो हम आपके डेटा को कैसे एकत्रित करते हैं, उसका उपयोग करते हैं और उसकी सुरक्षा करते हैं।</p>\r\n<p><strong>हम जो जानकारी एकत्रित करते हैं</strong></p>\r\n<p>व्यक्तिगत जानकारी: जब आप हमारी साइट पर रजिस्टर करते हैं, हमारे न्यूज़लेटर की सदस्यता लेते हैं, या कोई फ़ॉर्म भरते हैं, तो हम आपका नाम, ईमेल पता, फ़ोन नंबर और आपके द्वारा प्रदान की गई कोई अन्य जानकारी जैसी व्यक्तिगत जानकारी एकत्रित कर सकते हैं।</p>\r\n<p>गैर-व्यक्तिगत जानकारी: जब भी आगंतुक हमारी साइट से इंटरैक्ट करते हैं, तो हम उनके बारे में गैर-व्यक्तिगत जानकारी एकत्रित कर सकते हैं। इसमें ब्राउज़र का नाम, कंप्यूटर का प्रकार और हमारी साइट से जुड़ने के उपयोगकर्ताओं के साधनों के बारे में तकनीकी जानकारी, जैसे कि ऑपरेटिंग सिस्टम और उपयोग किए जाने वाले इंटरनेट सेवा प्रदाता और अन्य समान जानकारी शामिल हो सकती है।</p>\r\n<p>कुकीज़ और ट्रैकिंग तकनीकें: हमारी साइट उपयोगकर्ता अनुभव को बेहतर बनाने के लिए \"कुकीज़\" का उपयोग कर सकती है। उपयोगकर्ताओं के वेब ब्राउज़र रिकॉर्ड रखने के उद्देश्य से और कभी-कभी उनके बारे में जानकारी ट्रैक करने के लिए उनकी हार्ड ड्राइव पर कुकीज़ रखते हैं। उपयोगकर्ता अपने वेब ब्राउज़र को कुकीज़ को अस्वीकार करने या कुकीज़ भेजे जाने पर उन्हें सचेत करने के लिए सेट करना चुन सकते हैं। यदि वे ऐसा करते हैं, तो ध्यान दें कि साइट के कुछ हिस्से ठीक से काम नहीं कर सकते हैं।</p>\r\n<p><strong>हम एकत्रित जानकारी का उपयोग कैसे करते हैं</strong></p>\r\n<p>SkillGro निम्नलिखित उद्देश्यों के लिए उपयोगकर्ताओं की व्यक्तिगत जानकारी एकत्रित और उपयोग कर सकता है:</p>\r\n<p>ग्राहक सेवा में सुधार करने के लिए: आपके द्वारा प्रदान की गई जानकारी हमें आपके ग्राहक सेवा अनुरोधों और सहायता आवश्यकताओं का अधिक कुशलता से जवाब देने में मदद करती है।</p>\r\n<p>उपयोगकर्ता अनुभव को वैयक्तिकृत करने के लिए: हम यह समझने के लिए समग्र रूप से जानकारी का उपयोग कर सकते हैं कि हमारे उपयोगकर्ता एक समूह के रूप में हमारी साइट पर प्रदान की गई सेवाओं और संसाधनों का उपयोग कैसे करते हैं।</p>\r\n<p>हमारी साइट को बेहतर बनाने के लिए: हम अपने उत्पादों और सेवाओं को बेहतर बनाने के लिए आपके द्वारा प्रदान की गई प्रतिक्रिया का उपयोग कर सकते हैं।</p>\r\n<p>भुगतान संसाधित करने के लिए: हम ऑर्डर देते समय उपयोगकर्ताओं द्वारा अपने बारे में दी गई जानकारी का उपयोग केवल उस ऑर्डर को सेवा प्रदान करने के लिए कर सकते हैं। हम इस जानकारी को बाहरी पक्षों के साथ साझा नहीं करते हैं, सिवाय इसके कि सेवा प्रदान करने के लिए आवश्यक हो।</p>\r\n<p>आवधिक ईमेल भेजने के लिए: हम उपयोगकर्ता की जानकारी और उनके ऑर्डर से संबंधित अपडेट भेजने के लिए ईमेल पते का उपयोग कर सकते हैं। इसका उपयोग उनकी पूछताछ, प्रश्नों और/या अन्य अनुरोधों का जवाब देने के लिए भी किया जा सकता है।</p>\r\n<p><strong>हम आपकी जानकारी की सुरक्षा कैसे करते हैं</strong></p>\r\n<p>हम आपकी व्यक्तिगत जानकारी, उपयोगकर्ता नाम, पासवर्ड, लेन-देन की जानकारी और हमारी साइट पर संग्रहीत डेटा की अनधिकृत पहुँच, परिवर्तन, प्रकटीकरण या विनाश से सुरक्षा के लिए उचित डेटा संग्रह, भंडारण और प्रसंस्करण प्रथाओं और सुरक्षा उपायों को अपनाते हैं।</p>', '2024-06-05 01:15:39', '2024-06-05 01:30:05'),
(3, 1, 'ar', 'سياسة الخصوصية', '<p>مرحبًا بك في SkillGro! نحن نقدر خصوصيتك ونلتزم بحماية معلوماتك الشخصية. توضح سياسة الخصوصية هذه كيفية جمع بياناتك واستخدامها وحمايتها عند زيارتك لموقعنا الإلكتروني.</p>\r\n<p>المعلومات التي نجمعها</p>\r\n<p>المعلومات الشخصية: عندما تقوم بالتسجيل على موقعنا، أو الاشتراك في نشرتنا الإخبارية، أو ملء نموذج، قد نقوم بجمع معلومات شخصية مثل اسمك وعنوان بريدك الإلكتروني ورقم هاتفك وأي تفاصيل أخرى تقدمها.</p>\r\n<p>المعلومات غير الشخصية: قد نقوم بجمع معلومات غير شخصية عن الزوار عندما يتفاعلون مع موقعنا. وقد يشمل ذلك اسم المتصفح، ونوع الكمبيوتر، والمعلومات الفنية حول وسائل اتصال المستخدمين بموقعنا، مثل نظام التشغيل ومقدمي خدمات الإنترنت المستخدمة وغيرها من المعلومات المشابهة.</p>\r\n<p>ملفات تعريف الارتباط وتقنيات التتبع: قد يستخدم موقعنا \"ملفات تعريف الارتباط\" لتحسين تجربة المستخدم. تقوم متصفحات الويب الخاصة بالمستخدمين بوضع ملفات تعريف الارتباط على محرك الأقراص الثابتة الخاص بهم لأغراض حفظ السجلات وفي بعض الأحيان لتتبع المعلومات الخاصة بهم. يمكن للمستخدمين اختيار ضبط متصفح الويب الخاص بهم لرفض ملفات تعريف الارتباط أو لتنبيههم عند إرسال ملفات تعريف الارتباط. إذا فعلوا ذلك، لاحظ أن بعض أجزاء الموقع قد لا تعمل بشكل صحيح.</p>\r\n<p>كيف نستخدم المعلومات التي تم جمعها</p>\r\n<p>يجوز لـ SkillGro جمع واستخدام المعلومات الشخصية للمستخدمين للأغراض التالية:</p>\r\n<p>لتحسين خدمة العملاء: تساعدنا المعلومات التي تقدمها على الاستجابة لطلبات خدمة العملاء واحتياجات الدعم الخاصة بك بشكل أكثر كفاءة.</p>\r\n<p>لتخصيص تجربة المستخدم: قد نستخدم المعلومات بشكل إجمالي لفهم كيفية استخدام مستخدمينا كمجموعة للخدمات والموارد المقدمة على موقعنا.</p>\r\n<p>لتحسين موقعنا: قد نستخدم التعليقات التي تقدمها لتحسين منتجاتنا وخدماتنا.</p>\r\n<p>لمعالجة المدفوعات: يجوز لنا استخدام المعلومات التي يقدمها المستخدمون عن أنفسهم عند تقديم الطلب فقط لتقديم الخدمة لهذا الطلب. نحن لا نشارك هذه المعلومات مع أطراف خارجية إلا بالقدر اللازم لتقديم الخدمة.</p>\r\n<p>لإرسال رسائل بريد إلكتروني دورية: قد نستخدم عنوان البريد الإلكتروني لإرسال معلومات المستخدم والتحديثات المتعلقة بطلبه. ويمكن استخدامه أيضًا للرد على استفساراتهم و/أو أسئلتهم و/أو طلباتهم الأخرى.</p>\r\n<p>كيف نحمي معلوماتك</p>\r\n<p>نحن نعتمد ممارسات مناسبة لجمع البيانات وتخزينها ومعالجتها وتدابير أمنية للحماية من الوصول غير المصرح به أو التغيير أو الكشف أو إتلاف معلوماتك الشخصية واسم المستخدم وكلمة المرور ومعلومات المعاملات والبيانات المخزنة على موقعنا.</p>', '2024-06-05 01:15:39', '2024-06-05 01:30:45'),
(4, 2, 'en', 'terms and conditions', '<p>Please read these Terms and Conditions</p>\r\n<p>Your access to and use of the Service is conditioned on your acceptance of and compliance with these Terms. These Terms apply to all visitors, users, and others who access or use the Service.</p>\r\n<p>By accessing or using the Service you agree to be bound by these Terms. If you disagree with any part of the terms then you may not access the Service.</p>\r\n<p><strong>Accounts</strong></p>\r\n<p>When you create an account with us, you must provide us information that is accurate, complete, and current at all times. Failure to do so constitutes a breach of the Terms, which may result in immediate termination of your account on our Service.</p>\r\n<p>You are responsible for safeguarding the password that you use to access the Service and for any activities or actions under your password, whether your password is with our Service or a third-party service.</p>\r\n<p>You agree not to disclose your password to any third party. You must notify us immediately upon becoming aware of any breach of security or unauthorized use of your account.</p>\r\n<p><strong>Links To Other Web Sites</strong></p>\r\n<p>Our Service may contain links to third-party web sites or services that are not owned or controlled by SkillGro.</p>\r\n<p>SkillGro has no control over, and assumes no responsibility for, the content, privacy policies, or practices of any third-party web sites or services. You further acknowledge and agree that SkillGro shall not be responsible or liable, directly or indirectly, for any damage or loss caused or alleged to be caused by or in connection with use of or reliance on any such content, goods, or services available on or through any such web sites or services.</p>\r\n<p>We strongly advise you to read the terms and conditions and privacy policies of any third-party web sites or services that you visit.</p>\r\n<p><strong>Termination</strong></p>\r\n<p>We may terminate or suspend access to our Service immediately, without prior notice or liability, for any reason whatsoever, including without limitation if you breach the Terms.</p>\r\n<p>All provisions of the Terms which by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity and limitations of liability.</p>\r\n<p>We may terminate or suspend your account immediately, without prior notice or liability, for any reason whatsoever, including without limitation if you breach the Terms.</p>\r\n<p>Upon termination, your right to use the Service will immediately cease. If you wish to terminate your account, you may simply discontinue using the Service.</p>', '2024-06-05 01:33:02', '2024-06-05 01:33:02'),
(5, 2, 'hi', 'नियम और शर्तें', '<p>कृपया इन नियमों और शर्तों को पढ़ें</p>\r\n<p>सेवा तक आपकी पहुँच और उसका उपयोग इन शर्तों को स्वीकार करने और उनका अनुपालन करने पर निर्भर करता है। ये शर्तें सभी आगंतुकों, उपयोगकर्ताओं और अन्य लोगों पर लागू होती हैं जो सेवा तक पहुँचते हैं या उसका उपयोग करते हैं।</p>\r\n<p>सेवा तक पहुँचने या उसका उपयोग करके आप इन शर्तों से बंधे होने के लिए सहमत होते हैं। यदि आप शर्तों के किसी भी भाग से असहमत हैं तो आप सेवा तक नहीं पहुँच सकते।</p>\r\n<p>खाते</p>\r\n<p>जब आप हमारे साथ खाता बनाते हैं, तो आपको हमें हर समय सटीक, पूर्ण और वर्तमान जानकारी प्रदान करनी चाहिए। ऐसा न करना शर्तों का उल्लंघन माना जाता है, जिसके परिणामस्वरूप हमारी सेवा पर आपके खाते को तुरंत समाप्त किया जा सकता है।</p>\r\n<p>आप सेवा तक पहुँचने के लिए उपयोग किए जाने वाले पासवर्ड की सुरक्षा और अपने पासवर्ड के तहत किसी भी गतिविधि या कार्रवाई के लिए जिम्मेदार हैं, चाहे आपका पासवर्ड हमारी सेवा या किसी तीसरे पक्ष की सेवा के साथ हो।</p>\r\n<p>आप किसी तीसरे पक्ष को अपना पासवर्ड न बताने के लिए सहमत हैं। सुरक्षा के किसी भी उल्लंघन या आपके खाते के अनधिकृत उपयोग के बारे में पता चलने पर आपको हमें तुरंत सूचित करना चाहिए।</p>\r\n<p>अन्य वेब साइट्स के लिंक</p>\r\n<p>हमारी सेवा में थर्ड-पार्टी वेब साइट्स या सेवाओं के लिंक हो सकते हैं, जो SkillGro के स्वामित्व या नियंत्रण में नहीं हैं।</p>\r\n<p>SkillGro का किसी भी थर्ड-पार्टी वेब साइट्स या सेवाओं की सामग्री, गोपनीयता नीतियों या प्रथाओं पर कोई नियंत्रण नहीं है और न ही वह इसके लिए कोई जिम्मेदारी लेता है। आप आगे स्वीकार करते हैं और सहमत हैं कि SkillGro किसी भी ऐसी वेब साइट्स या सेवाओं पर या उनके माध्यम से उपलब्ध किसी भी ऐसी सामग्री, सामान या सेवाओं के उपयोग या उन पर निर्भरता के कारण या उनके संबंध में होने वाली किसी भी क्षति या हानि के लिए प्रत्यक्ष या अप्रत्यक्ष रूप से जिम्मेदार या उत्तरदायी नहीं होगा।</p>\r\n<p>हम आपको दृढ़ता से सलाह देते हैं कि आप अपने द्वारा देखी जाने वाली किसी भी थर्ड-पार्टी वेब साइट्स या सेवाओं की नियम और शर्तें और गोपनीयता नीतियां पढ़ें।</p>\r\n<p>समाप्ति</p>\r\n<p>हम बिना किसी पूर्व सूचना या देयता के, किसी भी कारण से, बिना किसी सीमा के, अपनी सेवा तक पहुंच को तुरंत समाप्त या निलंबित कर सकते हैं, जिसमें बिना किसी सीमा के यदि आप शर्तों का उल्लंघन करते हैं।</p>\r\n<p>शर्तों के सभी प्रावधान जो अपनी प्रकृति के अनुसार समाप्ति के बाद भी बने रहने चाहिए, समाप्ति के बाद भी बने रहेंगे, जिसमें बिना किसी सीमा के, स्वामित्व प्रावधान, वारंटी अस्वीकरण, क्षतिपूर्ति और देयता की सीमाएं शामिल हैं।</p>\r\n<p>हम बिना किसी पूर्व सूचना या दायित्व के, किसी भी कारण से, बिना किसी सीमा के, आपके खाते को तुरंत समाप्त या निलंबित कर सकते हैं, जिसमें बिना किसी सीमा के यदि आप शर्तों का उल्लंघन करते हैं।</p>\r\n<p>समाप्ति पर, सेवा का उपयोग करने का आपका अधिकार तुरंत समाप्त हो जाएगा। यदि आप अपना खाता समाप्त करना चाहते हैं, तो आप बस सेवा का उपयोग करना बंद कर सकते हैं।</p>', '2024-06-05 01:33:02', '2024-06-05 01:33:27'),
(6, 2, 'ar', 'الأحكام والشروط', '<p>يرجى قراءة هذه الشروط والأحكام (\"الشروط\"، \"الشروط والأحكام\") بعناية قبل استخدام موقع SkillGro الإلكتروني (\"الخدمة\") الذي تديره SkillGro (\"نحن\" أو \"نحن\" أو \"خاصتنا\").</p>\r\n<p>إن وصولك إلى الخدمة واستخدامها مشروط بقبولك لهذه الشروط والامتثال لها. تنطبق هذه الشروط على جميع الزوار والمستخدمين وغيرهم ممن يصلون إلى الخدمة أو يستخدمونها.</p>\r\n<p>من خلال الوصول إلى الخدمة أو استخدامها، فإنك توافق على الالتزام بهذه الشروط. إذا كنت لا توافق على أي جزء من الشروط، فلا يجوز لك الوصول إلى الخدمة.</p>\r\n<p>حسابات</p>\r\n<p>عندما تقوم بإنشاء حساب معنا، يجب عليك تزويدنا بمعلومات دقيقة وكاملة وحديثة في جميع الأوقات. ويشكل عدم القيام بذلك انتهاكًا للشروط، مما قد يؤدي إلى الإنهاء الفوري لحسابك في خدمتنا.</p>\r\n<p>أنت مسؤول عن حماية كلمة المرور التي تستخدمها للوصول إلى الخدمة وعن أي أنشطة أو إجراءات بموجب كلمة المرور الخاصة بك، سواء كانت كلمة المرور الخاصة بك مع خدمتنا أو خدمة تابعة لجهة خارجية.</p>\r\n<p>أنت توافق على عدم الكشف عن كلمة المرور الخاصة بك لأي طرف ثالث. يجب عليك إخطارنا فور علمك بأي خرق أمني أو استخدام غير مصرح به لحسابك.</p>\r\n<p>روابط لمواقع ويب أخرى</p>\r\n<p>قد تحتوي خدمتنا على روابط لمواقع أو خدمات ويب تابعة لجهات خارجية لا تملكها SkillGro أو تسيطر عليها.</p>\r\n<p>ليس لدى SkillGro أي سيطرة ولا تتحمل أي مسؤولية عن المحتوى أو سياسات الخصوصية أو الممارسات الخاصة بأي مواقع ويب أو خدمات تابعة لجهات خارجية. أنت تقر وتوافق أيضًا على أن SkillGro لن تكون مسؤولة، بشكل مباشر أو غير مباشر، عن أي ضرر أو خسارة ناجمة أو يُزعم أنها ناجمة عن أو فيما يتعلق باستخدام أو الاعتماد على أي محتوى أو سلع أو خدمات متاحة على أو من خلال أي مواقع ويب أو خدمات من هذا القبيل.</p>\r\n<p>ننصحك بشدة بقراءة الشروط والأحكام وسياسات الخصوصية الخاصة بأي مواقع ويب أو خدمات تابعة لجهات خارجية تقوم بزيارتها.</p>\r\n<p>نهاية</p>\r\n<p>يجوز لنا إنهاء أو تعليق الوصول إلى خدمتنا على الفور، دون إشعار مسبق أو مسؤولية، لأي سبب من الأسباب، بما في ذلك على سبيل المثال لا الحصر، إذا قمت بخرق الشروط.</p>\r\n<p>جميع أحكام الشروط التي بطبيعتها يجب أن تظل سارية بعد الإنهاء، يجب أن تظل سارية بعد الإنهاء، بما في ذلك، على سبيل المثال لا الحصر، أحكام الملكية وإخلاء المسؤولية عن الضمان والتعويض وحدود المسؤولية.</p>\r\n<p>يجوز لنا إنهاء حسابك أو تعليقه على الفور، دون إشعار مسبق أو مسؤولية، لأي سبب كان، بما في ذلك على سبيل المثال لا الحصر، إذا قمت بخرق الشروط.</p>\r\n<p>عند الإنهاء، سيتوقف حقك في استخدام الخدمة على الفور. إذا كنت ترغب في إنهاء حسابك، فيمكنك ببساطة التوقف عن استخدام الخدمة.</p>', '2024-06-05 01:33:02', '2024-06-05 01:34:01');
